import React from "react";
import './style.css';

const Recipes = ({ subtitle, image }) => {
  return (
    <>
      <div className="recipes">
          <h3>{ subtitle }</h3>
        <div>
          <img src={ image } alt="" />
        </div>
      </div>
    </>
  )
}

export default Recipes;
